import React, { Component } from 'react';
import { Navbar, Container, NavbarBrand, NavbarToggler, Collapse } from 'reactstrap';
import styles from './Header.module.scss';

export default class Header extends Component {
    constructor(props){
        super(props);
        this.useState = false;
    }




    render() {
        const [isOpen, setIsOpen] = this.useState;

        const toggle = () => setIsOpen(!isOpen);

        return (
            <Navbar className={styles.navbar} color='dark' dark expand='lg'>
                <Container>
                    <NavbarBrand href='/'>
                        <span className='navbar__logo'>labirinthia.ru</span>
                    </NavbarBrand>
                    <NavbarToggler>
                        <span></span>
                    </NavbarToggler>
                    <Collapse isOpen={isOpen} navbar></Collapse>
                </Container>
            </Navbar>
        );
    }
}
